import { Grid, Typography } from "@material-ui/core";
//import Paper from "@material-ui/core/Paper";


/*const Image = "https://cdn.pixabay.com/photo/2016/11/29/12/13/fence-1869401_1280.jpg";
const styles = {
  paperContainer: {
      backgroundImage: `url(${Image})`
  }
}; */

const Welcome = (props) => {
  return (
    <Grid
      container
      item
      direction="column"
      alignItems="center"
      justify="center"
      style={{ padding: "30px", minHeight: "93vh" }}
    >
      <Grid item>
        <Typography variant="h2">Welcome to JobBlitz</Typography>
      </Grid>
    </Grid> 
  );
};

export const ErrorPage = (props) => {
  return (
    <Grid
      container
      item
      direction="column"
      alignItems="center"
      justify="center"
      style={{ padding: "30px", minHeight: "93vh" }}
    >
      <Grid item>
        <Typography variant="h2">Error 404</Typography>
      </Grid>
    </Grid>
  );
};

export default Welcome;
